import Img from './Img'

function Profil(props){
    return(
         <div className>
             <Img img='/images/03.jpg'/>
             <h1>{props.FullName}</h1>
             <span>{props.Bio}</span>
             <span>{props.Profesion}</span>
         </div>
    )
}

export default Profil
